import React, { useState, useEffect } from 'react';
import './App.css';
import GetStarted from './pages/GetStarted';
import VideoTutorial from './pages/VideoTutorial';
import Dashboard from './pages/Dashboard';
import Classify from './pages/Classify';

// Storage wrapper that works in both environments
const storage = {
  async get(key) {
    try {
      if (window.storage && typeof window.storage.get === 'function') {
        return await window.storage.get(key);
      } else {
        // Fallback to localStorage
        const value = localStorage.getItem(key);
        return value ? { key, value } : null;
      }
    } catch (error) {
      const value = localStorage.getItem(key);
      return value ? { key, value } : null;
    }
  },

  async set(key, value) {
    try {
      if (window.storage && typeof window.storage.set === 'function') {
        return await window.storage.set(key, value);
      } else {
        // Fallback to localStorage
        localStorage.setItem(key, value);
        return { key, value };
      }
    } catch (error) {
      localStorage.setItem(key, value);
      return { key, value };
    }
  },

  async delete(key) {
    try {
      if (window.storage && typeof window.storage.delete === 'function') {
        return await window.storage.delete(key);
      } else {
        // Fallback to localStorage
        localStorage.removeItem(key);
        return { key, deleted: true };
      }
    } catch (error) {
      localStorage.removeItem(key);
      return { key, deleted: true };
    }
  }
};

function App() {
  const [user, setUser] = useState(null);
  const [hasSeenVideo, setHasSeenVideo] = useState(false);
  const [currentView, setCurrentView] = useState('start');
  const [complaints, setComplaints] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadData = async () => {
      try {
        const userResult = await storage.get('currentUser');
        const videoResult = await storage.get('hasSeenVideo');
        
        if (userResult && userResult.value) {
          const userData = JSON.parse(userResult.value);
          setUser(userData);
          await loadComplaints(userData.id);
        }
        
        if (videoResult && videoResult.value === 'true') {
          setHasSeenVideo(true);
        }
      } catch (error) {
        console.log('No stored data found:', error);
      } finally {
        setLoading(false);
      }
    };

    loadData();
  }, []);

  const loadComplaints = async (userId) => {
    try {
      const result = await storage.get(`complaints_${userId}`);
      if (result && result.value) {
        setComplaints(JSON.parse(result.value));
      }
    } catch (error) {
      console.log('No complaints found');
    }
  };

  const handleLogin = async (userData) => {
    setUser(userData);
    await storage.set('currentUser', JSON.stringify(userData));
    await loadComplaints(userData.id);
    setCurrentView('dashboard');
  };

  const handleLogout = async () => {
    setUser(null);
    setComplaints([]);
    await storage.delete('currentUser');
    setCurrentView('start');
  };

  const markVideoAsSeen = async () => {
    setHasSeenVideo(true);
    await storage.set('hasSeenVideo', 'true');
    setCurrentView('dashboard');
  };

  const handleSaveComplaint = async (complaint) => {
    if (user) {
      const updatedComplaints = [...complaints, complaint];
      setComplaints(updatedComplaints);
      await storage.set(`complaints_${user.id}`, JSON.stringify(updatedComplaints));
    }
  };

  const navigate = (view) => {
    setCurrentView(view);
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gradient-to-br from-purple-600 to-purple-800 flex items-center justify-center">
        <div className="text-white text-center">
          <div className="w-16 h-16 border-4 border-white border-t-transparent rounded-full animate-spin mx-auto mb-4"></div>
          <p className="text-lg">Loading...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="App">
      {currentView === 'start' && (
        <GetStarted onNext={() => setCurrentView('video')} />
      )}
      
      {currentView === 'video' && (
        <VideoTutorial 
          onComplete={markVideoAsSeen}
          onSkip={markVideoAsSeen}
        />
      )}
      
      {currentView === 'dashboard' && (
        <Dashboard 
          user={user}
          onLogout={handleLogout}
          onNavigate={navigate}
          complaints={complaints}
        />
      )}
      
      {currentView === 'classify' && (
        <Classify 
          user={user}
          onLogout={handleLogout}
          onNavigate={navigate}
          onLogin={handleLogin}
          onSaveComplaint={handleSaveComplaint}
        />
      )}
    </div>
  );
}

export default App;
